    price: 12.99,
 },
 {
    id: 'm4',
    name: 'Schnitzel',
    descripiton: 'A german specialty!',
    price: 23.9,
 },

];
const AvailableMeals = () => {
    const items= DUMMY_MEALS.map((item)=> <li>{item.name}</li>);

  return (

    <section className={classes.meals}>

       <u1 className={classes.meals} style={{listStyle:'none'}}>{items}</u1> 
    </section>
  );
}

export default AvailableMeals;
